// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./IPancakeRouter02.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./IToken.sol";

contract IndexSwap {
    address internal constant pancakeSwapAddress =
        0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3; //Router for pancake bsc testnet
    // address internal constant pancakeSwapAddress = 0x10ED43C718714eb63d5aA57B78B54704E256024E; //Router for bsc mainnet
    IPancakeRouter02 public pancakeSwapRouter;

    IToken public defiToken;
    IToken public nftToken;

    using SafeMath for uint256;

    address private crypto1 = 0x419816F160C9bf1Bb8F297d17E1bF44207B9E06C; // BTC
    address private crypto2 = 0x8BaBbB98678facC7342735486C851ABD7A0d17Ca; // ETH
    address private crypto3 = 0xb950614981c8bc650744347293e3AC4Ea8ff123B; // SHIBA
    address private crypto4 = 0x53E5D0c3702Fb163C8650ee74697BE9beF38b9E5; // XRP
    address private crypto5 = 0xC3c89a5Cd270BFB4f948CEF2151d818E3cB9bDD2; // LTC

    address private crypto6 = 0xf1955902806EE5b144691a3de9005951079d8458; // AXS
    address private crypto7 = 0xF5D59a1A7667c23EA6b369085b8C693bE6A6af5C; // MANA
    address private crypto8 = 0x54FA926a8C1241174aFd79F3F1Ea3219D11Afb7E; // SAND
    address private crypto9 = 0x2f6131AF2dcb1315BA63bCcd0a5E3a236A5C5c93; // THETA
    address private crypto10 = 0x190bB213CF401A4E5d8820b12198E92A858239C6; // FLOW

    struct rate {
        uint256 numerator;
        uint256 denominator;
    }
    mapping(address => uint256) admins;
    rate public currentRate;

    constructor() {
        pancakeSwapRouter = IPancakeRouter02(pancakeSwapAddress);
        defiToken = IToken(0xAe24BD25B1Aba33f69e97074aF954b1BF84B72Cb);
        nftToken = IToken(0xE870b73661Cc3De504FE26111748c08224EDBf63);
    }

    function updateRate(uint256 _numerator, uint256 _denominator) public {
        require(_numerator != 0);
        require(_denominator != 0);
        currentRate.numerator = _numerator;
        currentRate.denominator = _denominator;
    }

    function investInFundDefi() public payable {
        uint256 cryptoAmount = msg.value;
        // approve
        defiToken.approve(address(this), msg.value);

        // update rate
        updateRate(100, 100);

        uint256 deadline = block.timestamp + 15; // using now for convenience, for mainnet pass deadline from frontend!

        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto1),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto2),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto3),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto4),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto5),
            msg.sender,
            deadline
        );

        uint256 tokenAmount = cryptoAmount.mul(currentRate.numerator).div(
            currentRate.denominator
        );
        defiToken.mint(msg.sender, tokenAmount);
        // refund leftover ETH to user
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "refund failed");
    }

    function investInFundNFT() public payable {
        uint256 cryptoAmount = msg.value;
        // approve
        defiToken.approve(address(this), msg.value);

        // update rate
        updateRate(100, 100);

        uint256 deadline = block.timestamp + 15; // using now for convenience, for mainnet pass deadline from frontend!

        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto6),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto7),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto8),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto9),
            msg.sender,
            deadline
        );
        pancakeSwapRouter.swapExactETHForTokens{value: msg.value / 5}(
            0,
            getPathForETH(crypto10),
            msg.sender,
            deadline
        );

        uint256 tokenAmount = cryptoAmount.mul(currentRate.numerator).div(
            currentRate.denominator
        );
        nftToken.mint(msg.sender, tokenAmount);
        // refund leftover ETH to user
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "refund failed");
    }

    function withdrawFromFund(
        uint256 amount1,
        uint256 tokenAmount,
        address owner
    ) public payable {
        //   require(itoken.allowance > 0, Not allowed to transfer);
        uint256 deadline = block.timestamp + 15;
        nftToken.transferFrom(msg.sender, address(this), tokenAmount);
        nftToken.burn(address(this), tokenAmount);
        IToken(crypto1).approve(pancakeSwapAddress, amount1);
        IToken(crypto1).approve(owner, amount1);
        IToken(crypto1).transferFrom(msg.sender, address(this), amount1);
        // pancakeSwapRouter.swapExactTokensForTokens(usdt,usdt.mul(98).div(100),getPathForToken(crypto1),msg.sender,deadline);
        pancakeSwapRouter.swapExactTokensForETH(
            amount1,
            amount1.mul(95).div(100),
            getPathForToken(crypto1),
            owner,
            deadline
        );
    }

    // function addLiquidity() public payable{
    //   uint deadline = block.timestamp + 15;
    //   token.approve(pancakeSwapAddress,1000000000000000000000000000);
    //   // pancakeSwapRouter.addLiquidityEth{value: msg.value}();
    // }
    function getPathForETH(address crypto)
        public
        view
        returns (address[] memory)
    {
        address[] memory path = new address[](2);
        path[0] = pancakeSwapRouter.WETH();
        path[1] = crypto;
        return path;
    }

    function getPathForToken(address token)
        public
        view
        returns (address[] memory)
    {
        address[] memory path = new address[](2);
